INSERT INTO `tin_tuc` (`Ma_tin_tuc`, `Ten_tin_tuc`, `Ngay_dang`, `Noi_dung`, `Image`, `Trang_thai`) VALUES
(1, 'Apple chuyn sang dng USB-C, c th ngi dng Android s bt au u i rt nhiu', '26-07-2019', 'Bc chuyn tt yu\r\n\r\nCng ging nh tt c nhng ma h trc, cn bo tin n iPhone  a v. Mt trong nhng tin n ng ch  nht ni v cng kt ni ca iPhone 2019, ni Apple  loi b chun Lightning quen thuc  chuyn sang USB-C.\r\n\r\nThc cht, y l mt bc i gn nh khng c g bt ng. Chnh Apple l tn tui ln u tin gp phn cho USB-C thu ht c s ch  ca ngi tiu dng khi vn mn chic Macbook 12 inch vo nm 2014, trc khi Samsung v phn ln cc tn tui Android kp a cng kt ni ny ln in thoi ca h. Nm ngoi, Apple cng  a USB-C ln iPad Pro. Ph ch tch ph trch k thut phn cng ca Apple l John Ternus  tng khng nh v USB-C: \"Mt chic my tnh hiu nng cao i hi mt cng kt ni hiu nng cao\".\r\n\r\nVn  ca Apple lc ny l Lightning  qu li thi, thua km USB-C c v tc  d liu ln in nng truyn ti. Chuyn sang USB-C s gip Apple gii quyt mt trong nhng im thua km r rt nht ca iPhone so vi cc mu Android Trung Quc l tc  sc. Chuyn sang USB s gip m ra mt \"bu tri\" ph kin mi. Quan trng nht, chuyn sang USB-C s gip loi b im yu cui cng trong tri nghim hin ti ca cc iFan: phi mang nhiu loi cng cm khc nhau ch v Apple mun vy.', , 'Hot ng');
INSERT INTO `tin_tuc` (`Ma_tin_tuc`, `Ten_tin_tuc`, `Ngay_dang`, `Noi_dung`, `Image`, `Trang_thai`) VALUES
(2, 'Chm chn trong vic p dng camera gc rng, nhng iPhone 11 s c mt tnh nng vt tri so vi Android', '26-07-2019', 'Mt kiu p dng cng ngh rt \'Apple\'!\r\n\r\nMc d cha c ra mt, nhng iPhone 11  l r thit k cui cng, vi im nhn l h thng 3 camera siu ln  mt sau. 1 trong nhng camera  c cho l s c ng knh gc siu rng. ng knh siu rng  khng cn l tnh nng mi, khi nhng sn phm ca LG nh LG G5 v V20  c chng t tn 2016. T  n nay cng  c rt nhiu hng khc p dng camera siu rng vo sn phm ca mnh. Loi camera ny gip ngi dng chp c mt khng gian rng hn, t  to ra gc nhn n tng, hoc chp c nhng vt ln m khng cn phi li li qu xa.\r\nVi kiu p dng cng ngh rt \'Apple\', hng cng ngh ny khng s dng lun camera siu rng ngay nh cc hng Android, m i n pht trin \'chn\' ri mi dng. Hn na, iPhone 11 cng c cho l s c mt tnh nng c bit m nhng sn phm trc y cha c.\r\n\r\nTheo , mi khi ngi dng chp mt nh thng, my cng s t ng chp mt nh gc rng. Nh c tnh nng ny, nhng lc xem li nh m ngi dng mun nh \'m rng ra\' th ch cn nhn 1 nt l xong. Theo nh 9to5mac th tnh nng s c gi l Smart Frame (Khung nh thng minh). Smart Frame cng cho php ngi dng chnh li gc nhn  lm thng nh m khng cn phi thu nh chng li v my s t ng ly thm thng tin c sn t nhng bc nh gc rng. Phin bn gc rng ca cc bc nh s c gi trong mt thi gian nht nh, nhng s t ng xa v nhng l do v bo mt.', , 'Hot ng');
INSERT INTO `tin_tuc` (`Ma_tin_tuc`, `Ten_tin_tuc`, `Ngay_dang`, `Noi_dung`, `Image`, `Trang_thai`) VALUES
(3, 'Google ra mt Gallery Go, ng dng qun l nh cho smartphone gi r', '26-07-2019', 'ng dng ny nh, tn t dung lng nhng vn cung cp mt s tnh nng thit yu cho ngi dng.\r\nGoogle va m rng \"binh on\" ng dng Android Go ca h bng cch ro ra mt mt ng dng mi mang tn Gallery Go. ng dng ny thc cht l phin bn rt gn ca Google Photos v c ti u dnh cho cc thit b Android Go.\r\n\r\nGallery Go c kch thc ch di 10MB nn ngi dng thit b vi dung lng lu tr thp s khng cn lo lng vic ng dng ny chim nhiu ti nguyn. Ngoi ra n cn c u im khc na nh kh nng hot ng offline gip tit kim d liu di ng. D khng nhiu tnh nng nh Google Photos nhng Gallery Go c th sp xp nh t ng. Theo Google, mi m ng dng ny s t ng xp nh ca bn theo cc danh mc khc nhau, ty theo ni dung ca nh.\r\n\r\nGallery Go cng c th t ci thin cht lng nh cho bn nhng nu khng hi lng, cc cng c chnh sa nh i km s gip bn. ng nhin l cc cng c chnh sa ny khng tin tin c nh trn Google Photos nhng b li chng kh d dng.\r\n\r\nGallery Go cng h tr th mc v th SD. V th, bn c th sp xp hnh nh trong th mc cng nh c th di chuyn nh gia b lu tr trn thit b v th microSD. Hin ti, Gallery Go c sn  ti v trn Google Play, n h tr ton b thit b Android ch khng ch ring thit b Android Go.', , 'Hot ng');
INSERT INTO `tin_tuc` (`Ma_tin_tuc`, `Ten_tin_tuc`, `Ngay_dang`, `Noi_dung`, `Image`, `Trang_thai`) VALUES
(4, 'Vivo V17 v V17 Neo chun b ra mt, 2 camera trc dng trt, 4 camera sau', '26-07-2019', 'B i thuc dng V17 ca Vivo s c trnh lng trc thng 10 nm nay.\r\n\r\nTheo thng tin mi nht, Vivo ang gp rt pht trin dng V17  ra mt trc l hi Diwali, din ra vo thng 10 ti n . Gn y, hng smartphone Trung Quc  ngng kinh doanh V15 v V15 Pro ti n   sn sng cho n dng V17 mi d kin bao gm V17 v V17 Neo.\r\n\r\nThng tin r r cho thy Vivo V17 c th smartphone u tin vi 2 camera trc dng trt. D kin, 2 camera trc ca V17 s nm trn 1 cm duy nht, c th trt ra trt vo ch khng chia thnh 2 cm nh tai th. Pha sau my s c 4 camera vi camera chnh d kin dng cm bin 48MP.\r\n\r\nThng tin v Vivo V17 hin ti vn kh tha tht. Mc d vy, nhn vo V15 Pro chng ta c th on c mt vi c im chnh. V d, nh thit k camera trt, Vivo V17 s c mn hnh chim gn trn mt trc cng cm bin vn tay di mn hnh.\r\n\r\nTrong khi , V17 Neo d kin s c thit k mn hnh git nc. Cc thng s d kin i km vi Vivo 17 Neo gm chip MediaTek Helio P65, Android 9 Pie. Cha c bt c thng tin no v gi cng nh thi im ln k ca b i Vivo V17.', , 'Hot ng');

